import React from "react";
import { cn } from "../utils/cn";

const Terminal = ({ isDragging, height }) => {
  return (
    <div className={cn("shrink-0  contents", isDragging && "dragging")} style={{ height }}>
      Terminal
    </div>
  );
};

export default Terminal;
